//For admin side login
import React from 'react';
import { Link } from 'react-router-dom';
import { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

function Admin(){
    return (
        <form action="" method="post">

            <div class="container">
                <h1>Welcome Admin</h1>
                <button><Link to = "/edithome" id = "editpage"><div>editpage</div></Link></button>
                <label for="username"><b>Username: </b></label>
                <input type="text" placeholder="Enter Username" name="username" required = "true"/>

                <label for="password"><b>Password: </b></label>
                <input type="password" placeholder="Enter Password" name="password" required = "true"/>

                <button type="submit">Login</button>        
            </div>
        </form>
    )
}

export default Admin;
